    }

    async Task LoadVendas()
    {
        vendas = await http.GetFromJsonAsync<List<Venda>>("api/Vendas");
    }

    async Task ExcluirVendas(int ID)
    {
        await http.DeleteAsync($"api/Vendas/{ID}");
        await LoadVendas();


